/* tslint:disable */
/* eslint-disable */
// this is an auto generated file. This will be overwritten

export const getProducer = /* GraphQL */ `
  query GetProducer($id: ID!) {
    getProducer(id: $id) {
      id
      producerType
      IdType
      personalId
      name
      address
      city
      contact {
        name
        phone
        position
        area
        email
      }
      createdAt
      updatedAt
    }
  }
`;
export const listProducers = /* GraphQL */ `
  query ListProducers(
    $filter: ModelProducerFilterInput
    $limit: Int
    $nextToken: String
  ) {
    listProducers(filter: $filter, limit: $limit, nextToken: $nextToken) {
      items {
        id
        producerType
        IdType
        personalId
        name
        address
        city
        contact {
          name
          phone
          position
          area
          email
        }
        createdAt
        updatedAt
      }
      nextToken
    }
  }
`;
